import React from 'react'
import './ratings.css'
import {Grid} from "@mui/material";
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';

function Ratings(props){
    return(
        <div className="ratings" style={{display: 'flex', flexDirection: 'column'}}>
            <img  className="ratings-image" src={props?.professor?.img}/>
            <h4 style={{padding: '5px'}} className="ratings-info">{props?.professor?.name}</h4>
        </div>
    )
}
export default Ratings
